answers:
db.patients.aggregate([
  { $unwind: "$ENCOUNTERS" },
  { $unwind: "$ENCOUNTERS.PROCEDURES" },
  {
    $match: {
      "ENCOUNTERS.PROCEDURES.DESCRIPTION": "Depression screening using Patient Health Questionnaire Two-Item score (procedure)"
    }
  },
  {
    $group: { _id: "$ENCOUNTERS.DESCRIPTION" }
  },
  { $project: { _id: 0, ENCOUNTER_DESCRIPTION: "$_id" } }
])

db.patients.aggregate([
    {
        $unwind: "$CLAIMS"
    },
    {
        $unwind: "$CLAIMS.CLAIM_TRANSACTIONS"
    },
    {
        $match: {
            "CLAIMS.CLAIM_TRANSACTIONS.PAYER.NAME": "Cigna Health"
        }
    },
    {
        $project: {
            _id: 0,
            PATIENT_ID: 1,
            QUALITY_SCORE: {
                $toDouble: "$ENCOUNTERS.GENERAL_HEALTH_ASSESSMENT.QUALITY_SCORE"
            }
        }
    },
    {
        $group: {
            _id: {
                PATIENT_ID: "$PATIENT_ID"
            },
            avg_quality_score: {
                $avg: "$QUALITY_SCORE"
            }
        }
    },
    {
        $project: {
            _id: 0,
            PATIENT_ID: "$_id.PATIENT_ID",
            avg_quality_score: {
                $round: ["$avg_quality_score", 2]
            }
        }
    }
])

db.patients.aggregate([
  { $unwind: "$ENCOUNTERS" },
  { $unwind: "$ENCOUNTERS.CARE_PLANS" },
  {
    $match: {
      "ENCOUNTERS.CARE_PLANS.DESCRIPTION": "Infectious disease care plan (record artifact)"
    }
  },
  { $project: { _id: 0, encounter: "$ENCOUNTERS.DESCRIPTION" } }
])

db.patients.aggregate([
    { $unwind: "$OBSERVATIONS" },
    { $match: {"OBSERVATIONS.DESCRIPTION": "Body mass index (BMI) [Ratio]"} },
    { $group: { 
        _id: null, 
        COLLECTION_DATE: {$first: "$OBSERVATIONS.COLLECTION_DATE"} 
    }},
    { $project: { 
        _id: 0, 
        COLLECTION_DATE: 1 
    }}
])
